import React from 'react';
//import axios from 'axios';

import styles from '../Main.module.css';
import taskStyles from './Task1.module.css';

class Task1 extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
          isFetching: false
        };
      }

    submitHandle(event) {
        event.preventDefault();
        const form = event.target;
        const data = new FormData(form);

        fetch('//localhost:8080/hi', {
            method: 'PUT',
            body: data
        })
        .then(response => response.json())
        .then(result => {
          console.log('Success:', result);
        })
        .catch(error => {
          console.error('Error:', error);
        });
    }

    render() {
        const fetchBlock = (this.state.isFetching) ?
            <div className={styles.loadingPane}> Fetching... </div>
            :null;

        const mainTask =
            <div className={taskStyles.taskMain}>
                <div className={taskStyles.inputFormDiv}>
                    <form onSubmit={this.submitHandle}>
                        <label for='picture'>Zamieść Obraz</label><br />
                        <input type="file" id="picture" /><br />
                        <label for='alphaStep'>Krok ∆α układu emiter/detektor</label><br />
                        <input type='number' id='alphaStep' /><br />
                        <label for='count'>Liczba detektorów</label><br />
                        <input type='number' id='count' /><br />
                        <label for='spread'>Rozwartość detektorów</label><br />
                        <input type='number' id='spread' /><br />
                        <input type='submit' value='Generate' /><br />
                    </form>
                </div>
                <div className={taskStyles.imageView} id='inputImage'>
                </div>
                <div className={taskStyles.imageView} id='processImage'>
                </div>
                <div className={taskStyles.imageView} id='outputImage'>
                </div>
            </div>

        return (
            <main>
               {fetchBlock}
               {mainTask}
            </main>
        )}
}

export default Task1;
